import React from 'react';

const Weather = () => {
    return(
        <div>
            <h1>City, Country</h1>
            <ul>
                <li>current weather</li>
                <li>current temp</li>
                <li>current humidity</li>
            </ul>
        </div>
    );
};

export default Weather;
